"use strict";document.addEventListener("DOMContentLoaded",function(){return watchNavbarPosition()});var watchNavbarPosition=function(){var t=document.getElementsByClassName("navbar")[0],n=t.offsetTop;rxjs.fromEvent(window,"scroll",{passive:!0}).pipe(rxjs.operators.filter(function(){return window.pageYOffset>=n&&!t.classList.contains("navbar--sticky")||window.pageYOffset<n&&t.classList.contains("navbar--sticky")})).subscribe(function(){window.pageYOffset>=n?t.classList.add("navbar--sticky"):t.classList.remove("navbar--sticky")})},hoverOrganizationTitle=function(t){t.parentElement.children[0].children[1].style.opacity=1},leaveOrganizationTitle=function(t){t.parentElement.children[0].children[1].style.opacity=0};